type Props = {
  name: string
  picture: string
}

const Avatar = ({ name, picture }: Props) => {
  return (
    <div>
      <img 
        src={picture} 
        alt={name} 
        style={{
          borderRadius: '50%'
        }}
      />
      <div>{name}</div>
    </div>
  )
}

export default Avatar
